import react from "react"
import ReactDom from 'react-dom'
import './index.css'
var cur = new Date(20)
let greet = ""
const cssstyle = {}
if (cur.getHours() >= 1 && cur.getHours() <= 11) {
  greet = "Morning"
  cssstyle.color = "green"
}
else if (cur.getHours() > 11 && cur.getHours() <= 19) {
  greet = "Evening"
  cssstyle.color = "orange"
}
else {
  greet = "Night"
  cssstyle.color = "blue"
}
ReactDom.render(<><div className="greeting"><h1>Hello Sir <span style={cssstyle}>Good {greet}</span></h1></div></>, document.getElementById('root'))
